import React from "react";
import TableRow from './TableRow'

function Home( list ) {
  return (
    <div className="container">
        <table className="table table-hover">
            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col">Name</th>
                    <th scope="col">Location</th>
                </tr>
            </thead>
            <tbody>
                {list.map( employee => <TableRow {...employee} /> )}
            </tbody>
        </table>
    </div>
  );
}

export default Home;
